import "./header.css"
function Header() {
    return <header >
        <nav>
            <img src="https://s.tmimgcdn.com/scr/1200x750/315200/design-de-logotipo-de-construcao-para-todas-as-empresas_315298-original.jpg" alt="Logo Marca" />
            
        </nav>
    </header>
}

export default Header;
